window.bookSummaryJSON = "<p>With Keira finding death at her door, she is suddenly plunged into a world of the unknown and has to face it alone...or does she? Soon this new life is filled with heartache, shadowed followers and cryptic messages that promise only to lead her deeper into world of the supernatural like never before. </p><p>For Keira, even taking a breath without the other half of her soul is painful enough. So when given the choice either to accept what life the fates have decided she live or to force that life behind her and accept the dangerous journey ahead, the answer is easy.... </p><p>She will fight to save the man she loves. But this fight includes heaven and hell in search of the truth, a truth that will either set her heart free or be destroyed on the other side. Are the fates really to be trusted? </p>"; 
